module.exports = a = async ({params}) => {
    console.log('params: ', params);

    try {
        const devices = JSON.parse(params.input);

        if (!Array.isArray(devices)) {
            throw new Error("Parsed input is not an array");
        }

        const deviceEntries = [];
        let totpActive = false;

        for (const device of devices) {
            const { id, type, email, phone, nickname } = device;

            if (!id || !type) continue;

            switch (type.toUpperCase()) {
                case "EMAIL":
                    if (email) {
                        deviceEntries.push(`Email: ${email}=${id}`);
                    }
                    break;
                case "SMS":
                    if (phone) {
                        deviceEntries.push(`Text: ${phone}=${id}`);
                    }
                    break;
                case "VOICE":
                    if (phone) {
                        deviceEntries.push(`Call: ${phone}=${id}`);
                    }
                    break;
                case "TOTP":
                    // Include even if nickname is empty
                    deviceEntries.push(`Authenticator App${nickname ? ` (${nickname})` : ''}=${id}`);
                    totpActive = true;
                    break;
                default:
                    continue;
            }
        }

        if (deviceEntries.length === 0) {
            throw new Error("No valid MFA devices found.");
        }

        const mfaButtons = deviceEntries.join(',');

        const changeMethod = deviceEntries.length > 1 
            ? `<button id="changeMethod" type="button" data-skcomponent="skbutton" data-skbuttontype="next-event" data-skbuttonvalue="CANCEL">Change Method</button>`
            : "";

        return {
            mfaButtons,
            totpActive,
            changeMethod
        };

    } catch (error) {
        console.error("Error parsing input or formatting output: ", error);
        throw new Error("Failed to generate device list string: " + error.message);
    }
}

